  background-color: #fff;
  overflow-y: auto; }

body, input, select, button {
  font-size: 16px;
  color: #222; }

/*-------------------------------------*/
/* GLOBAL STYLES */
a {
  text-decoration: none; }

strong, b {
  font-weight: 700; }

em, i {
  font-style: italic; }

sub, sup {
  font-size: 65%;
  position: relative;
  line-height: 0; }

sup {
  top: -8px; }

sub {
  bottom: -8px; }

p {
  margin: 0 0 15px 0; }

h6 {
  font-size: 110%; }

h5 {
  font-size: 120%; }

h4 {
  font-size: 130%; }

h3 {
  font-size: 140%; }

h2 {
  font-size: 160%; }

h1 {
  font-size: 180%; }

h1, h2, h3, h4, h5, h6 {
  padding: 0 0 15px 0; }

ol, ul {
  padding-left: 20px;
  list-style-position: inside; }

ol {
  list-style-type: decimal; }

ul {
  list-style-type: disc; }

img, video, svg {
  max-width: 100%;
  height: auto; }

input[type="submit"] {
  -moz-appearance: none;
  -webkit-appearance: none;
  appearance: none; }

input[type="submit"], button {
  cursor: pointer; }

textarea {
  min-height: 150px;
  vertical-align: top; }

table {
  border-collapse: collapse; }

th, td {
  border: 1px solid;
  padding: 20px; }

th {
  font-weight: 700; }

/*-------------------------------------*/
/* HELPERS */
/* Helpers: Floats and Clearing */
.clearfix:after {
  content: "";
  display: table;
  clear: both; }

.clear {
  clear: both; }

.float-left {
  float: left; }

.float-right {
  float: right; }

/* Helpers: Typography */
.heading-primary {
  text-align: center;
  font-size: 220%;
  padding: 40px 0; }

.heading-secondary {
  font-size: 130%;
  text-align: center;
  text-transform: uppercase;
  padding: 20px 0; }

.ul-base {
  padding: 0;
  list-style-type: none; }

.font-small {
  font-size: 90%; }

.font-smaller {
  font-size: 80%; }

.font-smallest {
  font-size: 70%; }

.font-large {
  font-size: 110%; }

.font-larger {
  font-size: 120%; }

.font-largest {
  font-size: 130%; }

/* Helpers: Centering */
.center {
  text-align: center; }

.center-element {
  margin-left: auto;
  margin-right: auto;
  display: block; }

.vertical-center {
  position: absolute;
  top: 50%;
  -webkit-transform: translateY(-50%);
  transform: translateY(-50%); }

.dead-center {
  position: absolute;
  top: 50%;
  left: 50%;
  -webkit-transform: translateX(-50%) translateY(-50%);
  transform: translateX(-50%) translateY(-50%); }

/* Helpers: Full-width */
.full-width {
  display: block;
  width: 100%; }

/* Helpers: Form */
.field-block {
  padding: 10px 0; }

.label {
  text-align: center;
  display: block;
  position: relative;
  padding: 0 0 10px 0; }

.label-required:after {
  content: "*";
  color: red;
  margin: 0 0 0 5px; }

.input-text {
  display: block;
  width: 100%;
  padding: 10px;
  background-color: rgba(255, 255, 255, 0.9);
  border: 1px solid #bbb; }

.input-text:fucus {
  border: 1px solid #888;
  outline: 0; }

.input-text.input-error {
  border: 1px solid red; }

/* Helpers: Buttons */
.button {
  color: #fff;
  background-color: #777;
  padding: 10px 20px;
  display: inline-block;
  border: 1px;
  cursor: pointer;
  min-width: 100px; }

/*-------------------------------------*/
/* GRID */
.grid-parent {
  margin-left: -15px;
  margin-right: -15px; }

.grid-parent:after {
  content: "";
  display: table;
  clear: both; }

.grid-child {
  padding-left: 15px;
  padding-right: 15px; }

/*-------------------------------------*/
/* CONTAINERS */
.container-full, .container-main, .container-mid, .container-sm, .container-xs {
  margin-left: auto;
  margin-right: auto;
  padding-left: 15px;
  padding-right: 15px; }

.container-full {
  max-width: 100%; }

.container-main {
  max-width: 1200px; }

.container-mid {
  max-width: 900px; }

.container-sm {
  max-width: 700px; }

.container-xs {
  max-width: 600px; }

/*-------------------------------------*/
/* LAYOUT: HEADER */
.header {
  background-color: #555;
  color: #fff; }

.header a {
  color: inherit; }

/* Header: Logo */
.logo {
  padding: 10px 0 0 0;
  display: block; }

/* Header: Navigation */
.nav li a {
  padding: 10px; }

@media only screen and (min-width: 700px) {
  .logo-block {
    float: left; }
  .nav-block {
    float: right; }
  .nav li, .nav li a {
    display: inline-block;
    vertical-align: top; } }

/*-------------------------------------*/
/* LAYOUT: FOOTER */
.footer {
  height: 80px;
  margin: 40px 0;
  text-align: center;
  padding: 10px 0; }

.footer a {
  color: #555; }

.footer-copyright-block {
  font-size: 80%;
  margin: 10px 0 0 0; }

@media only screen and (min-width: 700px) {
  .footer {
    text-align: left; }
  .footer-social-block {
    float: left; }
  .footer-copyright-block {
    float: right; } }

